(2, 'LAHAVA phát hành phiếu quà tặng với nhiều mệnh giá', 'lahava-phat-hanh-phieu-qua-tang-voi-nhieu-menh-gia', 'lahava phat hanh phieu qua tang voi nhieu menh gia', 'https://www.lahava.vn/blog/cat/su-kien/post/lahava-phat-hanh-phieu-qua-tang-voi-nhieu-menh-gia/', 'Từ th&aacute;ng 5/2015 LAHAVA sẽ ph&aacute;t h&agrave;nh Phiếu qu&agrave; tặng với 3 mệnh gi&aacute; l&agrave; 300,000đ - 500,000đ - 1,000,000đ để tiện cho kh&aacute;ch h&agrave;ng trong việc mua sắm cũng như biếu tặng cho người th&acirc;n...', 'media/wysiwyg/lahava-vouchers.jpg', 1, 1, NULL, 0, 1, 49, 0, '2018-03-11 21:52:00', '2018-03-11 22:04:46', 1, 1),
(3, 'Thuê áo dài cưới đẹp giá rẻ tại TPHCM', 'thue-ao-dai-cuoi-dep-gia-re-tai-tphcm', 'thue ao dai cuoi dep gia re tai tphcm', 'https://www.lahava.vn/blog/cat/su-kien/post/thue-ao-dai-cuoi-dep-gia-re-tai-tphcm/', 'Nếu bạn đang t&igrave;m kiếm cho m&igrave;nh một dịch vụ cho thu&ecirc; &aacute;o d&agrave;i cưới đẹp gi&aacute; rẻ v&agrave; theo số đo của m&igrave;nh th&igrave; h&atilde;y c&ugrave;ng tham khảo 1 dịch vụ cho thu&ecirc; &aacute;o d&agrave;i cưới đặc biệt n&agrave;y chỉ c&oacute; ở LAHAVA.', 'media/wysiwyg/thue-ao-dai.jpg', 1, 1, NULL, 0, 1, 53, 0, '2018-03-11 21:52:00', '2018-03-11 22:04:49', 1, 1),
(4, 'Chương trình khuyến mãi mừng sinh nhật lần thứ 5 và Quốc tế Phụ nữ', 'chuong-trinh-khuyen-mai-mung-sinh-nhat-lan-thu-5-va-quoc-te-phu-nu', 'chuong trinh khuyen mai mung sinh nhat lan thu 5 va quoc te phu nu', 'https://www.lahava.vn/blog/cat/su-kien/post/chuong-trinh-khuyen-mai-mung-sinh-nhat-lan-thu-5-va-quoc-te-phu-nu/', 'Kỹ niệm LAHAVA được 5 tuổi (05/03/2011 - 05/03/2016) v&agrave; ng&agrave;y Quốc tế Phụ nữ 08/03 LAHAVA c&oacute; chương tr&igrave;nh khuyễn m&atilde;i giảm gi&aacute; tất cả c&aacute;c sản phẩm tr&ecirc;n website kể từ ng&agrave;y...', 'media/wysiwyg/sn-lahava.jpg', 1, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:52:00', '2018-03-11 22:05:09', 1, 1),
(5, 'LAHAVA hoạt động lại bình thường sau 2 tháng sửa chữa', 'lahava-hoat-dong-lai-binh-thuong-sau-2-thang-sua-chua', 'lahava hoat dong lai binh thuong sau 2 thang sua chua', 'https://www.lahava.vn/blog/cat/su-kien/post/lahava-hoat-dong-lai-binh-thuong-sau-2-thang-sua-chua/', 'LAHAVA đ&atilde; ch&iacute;nh thức hoạt động lại b&igrave;nh thường tại địa chỉ 84 Nguyễn Văn Trỗi, Phường 8, Ph&uacute; nhuận, HCM sau hơn 2 th&aacute;ng sửa chữa v&agrave; n&acirc;ng cấp...', 'https://c2.staticflickr.com/2/1702/26600382192_9a0005014d_o.jpg', 1, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:52:00', '2018-03-11 22:05:12', 1, 1),
(6, 'Tuyển thợ vẽ áo dài, thêu máy, thêu tay và thiết kế', 'tuyen-tho-ve-ao-dai-theu-may-theu-tay-va-thiet-ke', 'tuyen tho ve ao dai theu may theu tay va thiet ke', 'https://www.lahava.vn/blog/cat/su-kien/post/tuyen-tho-ve-ao-dai-theu-may-theu-tay-va-thiet-ke/', 'Với nhu cầu ng&agrave;y c&agrave;ng ph&aacute;t triển, LAHAVA lu&ocirc;n mong muốn được hợp t&aacute;c với những người trẻ tuổi v&agrave; t&agrave;i năng trong lĩnh vực thời trang, nếu bạn đang học v&agrave; l&agrave;m việc trong lĩnh vực n&agrave;y, h&atilde;y cho ch&uacute;ng ta một cơ hội để c&ugrave;ng nhau l&agrave;m việc.', 'media/wysiwyg/tuyen-tho-ve-ao-dai.jpg', 1, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:52:00', '2018-03-11 22:05:12', 1, 1),
(7, 'Khoảnh khắc đăng quang của thí sinh Miss Áo dài LAHAVA 2017', 'khoanh-khac-dang-quang-cua-thi-sinh-miss-ao-dai-lahava-2017', 'khoanh khac dang quang cua thi sinh miss ao dai lahava 2017', 'https://www.lahava.vn/blog/cat/su-kien/post/khoanh-khac-dang-quang-cua-thi-sinh-miss-ao-dai-lahava-2017/', 'Tối ng&agrave;y 20/01/2017 vừa qua C&ocirc;ng ty CP Thời trang LAHAVA vừa tổ chức cuộc thi Miss &Aacute;o D&agrave;i LAHAVA 2017, sau khi được kh&aacute;n giả v&agrave; BGK lựa chọn th&igrave; 3 th&iacute; sinh c&ograve;n lại l&agrave; 3 th&iacute; xinh xuất sắc nhất.', 'media/wysiwyg/2017/missaodai-lahava.jpg', 1, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:52:00', '2018-03-11 22:05:28', 1, 1),
(8, 'LAHAVA mừng sinh nhật 6 tuổi với chương trình khuyến mãi khủng', 'lahava-mung-sinh-nhat-6-tuoi-voi-chuong-trinh-khuyen-mai-khung', 'lahava mung sinh nhat 6 tuoi voi chuong trinh khuyen mai khung', 'https://www.lahava.vn/blog/cat/su-kien/post/lahava-mung-sinh-nhat-6-tuoi-voi-chuong-trinh-khuyen-mai-khung/', 'Mừng sự kiện lớn nhất trong năm của LAHAVA, sinh nhật lần thứ 6 với chương tr&igrave;nh khuyến m&atilde;i cực khủng sale off l&ecirc;n đến 50% c&aacute;c sản phẩm c&oacute; sẵn', 'media/wysiwyg/2017/saleoff.jpg', 1, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:52:00', '2018-03-11 22:05:28', 1, 1),
(9, 'LAHAVA làm việc bình thường lại sau chuyến khám phá Thái lan', 'lahava-lam-viec-binh-thuong-lai-sau-chuyen-kham-pha-thai-lan', 'lahava lam viec binh thuong lai sau chuyen kham pha thai lan', 'https://www.lahava.vn/blog/cat/su-kien/post/lahava-lam-viec-binh-thuong-lai-sau-chuyen-kham-pha-thai-lan/', 'LAHAVA l&agrave;m việc b&igrave;nh thường lại v&agrave;o ng&agrave;y 04/08/2017 sau chuyến du lịch kh&aacute;m ph&aacute; tại xứ sở Ch&ugrave;a v&agrave;ng Th&aacute;i lan, chuyến đi k&eacute;o d&agrave;i 3 ng&agrave;y 2 đ&ecirc;m nhưng đ&atilde; để lại nhiều kỷ niệm đẹp trong l&ograve;ng mỗi th&agrave;nh vi&ecirc;n LAHAVA', 'media/wysiwyg/2017/lahava-congty.jpg', 1, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:52:00', '2018-03-11 22:05:34', 1, 1),
(10, 'Xu hướng váy dạ hội đuôi cá 2015', 'xu-huong-vay-da-hoi-duoi-ca-2015', 'xu huong vay da hoi duoi ca 2015', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/xu-huong-vay-da-hoi-duoi-ca-2015/', '2015 với những thiết kế tập trung v&agrave;o kỹ thuật v&agrave; xử l&yacute; chất liệu, l&agrave;m cho bạn th&ecirc;m sự sang trọng v&agrave; t&ocirc;n v&oacute;c d&aacute;ng, cườm đ&aacute; sẽ l&agrave;m cho chiếc v&aacute;y bạn th&ecirc;m lấp l&aacute;nh...', 'media/wysiwyg/vay-da-hoi-blog.jpg', 2, 1, NULL, 0, 1, 4, 0, '2018-03-11 21:54:29', '2018-03-11 22:04:36', 1, 1),
(11, 'Những mẫu váy ren ngắn dự tiệc quyến rũ', 'nhung-mau-vay-ren-ngan-du-tiec-quyen-ru', 'nhung mau vay ren ngan du tiec quyen ru', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/nhung-mau-vay-ren-ngan-du-tiec-quyen-ru/', 'V&aacute;y ren ngắn bao giờ cũng mang lại cho bạn n&eacute;t trẻ trung v&agrave; quyến rũ, những mẫu đầm dự tiệc cưới được thiết kế xo&egrave; c&ocirc;ng ch&uacute;a dễ thương, d&aacute;ng v&aacute;y c&uacute;p ngực cho bạn sự gợi cảm....', 'media/wysiwyg/vay-ren-ngan-blog.jpg', 2, 1, NULL, 0, 1, 7, 0, '2018-03-11 21:54:29', '2018-03-11 22:04:36', 1, 1),
(12, 'Những mẫu váy dạ hội gợi cảm cho doanh nhân', 'nhung-mau-vay-da-hoi-goi-cam-cho-doanh-nhan', 'nhung mau vay da hoi goi cam cho doanh nhan', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/nhung-mau-vay-da-hoi-goi-cam-cho-doanh-nhan/', 'Việc xuất hiện ở một sự kiện, một đ&aacute;m cưới hoặc một buổi tiệc... th&igrave; h&igrave;nh ảnh của bạn sẽ được ch&uacute; &yacute; rất nhiều, đặc biệt khi bạn l&agrave; doanh nh&acirc;n, điều đ&oacute; c&agrave;ng thể hiện r&otilde; hơn sự đẳng cấp, hiện đại v&agrave; c&aacute; t&iacute;nh của m&igrave;nh qua trang phục bạn mặc....', 'media/wysiwyg/vay-da-hoi-blog_1.jpg', 2, 1, NULL, 0, 1, 11, 0, '2018-03-11 21:54:29', '2018-03-11 22:04:36', 1, 1),
