(14, 'Những mẫu đầm dạ hội màu đen che khuyết điểm đẹp nhất', 'nhung-mau-dam-da-hoi-mau-den-che-khuyet-diem-dep-nhat', 'nhung mau dam da hoi mau den che khuyet diem dep nhat', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/nhung-mau-dam-da-hoi-mau-den-che-khuyet-diem-dep-nhat/', 'Bạn kh&ocirc;ng tự tin với v&oacute;c d&aacute;ng của m&igrave;nh nhưng lại muốn t&igrave;m ra một mẫu đầm dạ hội vừa che khuyết điểm tốt lại vừa sang trọng, M&agrave;u đen, đ&oacute; l&agrave; t&ocirc;ng m&agrave;u bạn sẽ nghĩ đến ngay khi t&igrave;m ra một &yacute; tượng n&agrave;o đ&oacute; cho chiếc v&aacute;y của m&igrave;nh....', 'media/wysiwyg/dam-da-hoi-mau-den.jpg', 2, 1, NULL, 0, 1, 16, 0, '2018-03-11 21:54:31', '2018-03-11 22:04:39', 1, 1),
(15, 'BST những mẫu váy dạ hội màu đỏ nổi bật và đẹp nhất', 'bst-nhung-mau-vay-da-hoi-mau-do-noi-bat-va-dep-nhat', 'bst nhung mau vay da hoi mau do noi bat va dep nhat', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/bst-nhung-mau-vay-da-hoi-mau-do-noi-bat-va-dep-nhat/', 'Nếu bạn th&iacute;ch sự nổi bật, bạn l&agrave; người c&aacute; t&iacute;nh, th&iacute;ch phong c&aacute;ch gợi cảm v&agrave; quyến rũ...th&igrave; h&atilde;y chọn m&agrave;u đỏ. Những t&ocirc;ng m&agrave;u như đỏ tươi, đỏ đ&ocirc; cũng l&agrave;m cho bạn th&ecirc;m trang trọng hơn, v&agrave; để lại những khoảnh khắc đ&aacute;ng nhớ cho mỗi lần xuất hiện....', 'media/wysiwyg/dam-da-hoi-mau-do.jpg', 2, 1, NULL, 0, 1, 17, 0, '2018-03-11 21:54:31', '2018-03-11 22:04:39', 1, 1),
(16, 'Gợi ý những mẫu váy dạ hội tôn da và giúp bạn quý phái hơn', 'goi-y-nhung-mau-vay-da-hoi-ton-da-va-giup-ban-quy-phai-hon', 'goi y nhung mau vay da hoi ton da va giup ban quy phai hon', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/goi-y-nhung-mau-vay-da-hoi-ton-da-va-giup-ban-quy-phai-hon/', 'L&agrave; phụ nữ ai cũng mong m&igrave;nh được xinh đẹp hơn v&agrave; nổi bật hơn khi xuất hiện tại sự kiện, tiệc cưới... tuy nhi&ecirc;n để chọn được trang phụ vừa đẹp lại vừa che khuyết điểm, t&ocirc;n da v&agrave; l&agrave;m cho bạn trở n&ecirc;n qu&yacute; ph&aacute;i hơn th&igrave; kh&ocirc;ng phải ai cũng l&agrave;m được....', 'media/wysiwyg/dam-da-hoi-ton-da.jpg', 2, 1, NULL, 0, 1, 18, 0, '2018-03-11 21:54:31', '2018-03-11 22:04:39', 1, 1),
(17, 'Đầm dạ hội sang trọng và đẹp nhất 2015', 'dam-da-hoi-sang-trong-va-dep-nhat-2015', 'dam da hoi sang trong va dep nhat 2015', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/dam-da-hoi-sang-trong-va-dep-nhat-2015/', 'Năm 2015 với những thay đổi trong thiết kế cũng như chất liệu, v&aacute;y dạ hội 2015 d&ugrave;ng c&aacute;c chất liệu như lưới mềm, ren th&ecirc;u, chiffon...kết hợp với hoạ tiết hoa v&agrave; cườm...l&agrave;m cho chiếc v&aacute;y th&ecirc;m ấn tượng v&agrave; lấp l&aacute;nh hơn', 'media/wysiwyg/xu-huong-dam-da-hoi.jpg', 2, 1, NULL, 0, 1, 19, 0, '2018-03-11 21:54:31', '2018-03-11 22:04:39', 1, 1),
(18, 'Người mập có mặc được váy dạ hội đuôi cá?', 'nguoi-map-co-mac-duoc-vay-da-hoi-duoi-ca', 'nguoi map co mac duoc vay da hoi duoi ca', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/nguoi-map-co-mac-duoc-vay-da-hoi-duoi-ca/', 'Nhiều người sẽ nghĩ đầm dạ hội đu&ocirc;i c&aacute; chỉ d&agrave;nh cho th&acirc;n h&igrave;nh c&acirc;n đối v&agrave; d&aacute;ng cao, v&igrave; d&aacute;ng v&aacute;y đu&ocirc;i c&aacute; rất k&eacute;n d&aacute;ng, hơn nữa cũng sẽ kh&oacute; di chuyển, nhưng thực tế nếu bạn mặc 1 lần v&aacute;y đu&ocirc;i c&aacute; sẽ c&oacute; c&aacute;i nh&igrave;n kh&aacute;c về mẫu v&aacute;y n&agrave;y...', 'media/wysiwyg/dam-da-hoi-duoi-ca.jpg', 2, 1, NULL, 0, 1, 20, 0, '2018-03-11 21:54:31', '2018-03-11 22:04:39', 1, 1),
(19, 'Những mẫu đầm dạ hội màu xanh ngọt ngào nhất', 'nhung-mau-dam-da-hoi-mau-xanh-ngot-ngao-nhat', 'nhung mau dam da hoi mau xanh ngot ngao nhat', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/nhung-mau-dam-da-hoi-mau-xanh-ngot-ngao-nhat/', 'M&agrave;u xanh lu&ocirc;n mang lại cho bạn sự tươi m&aacute;t, năng động v&agrave; ngọt ng&agrave;o, đầm dạ hội m&agrave;u xanh cũng vậy, cho ch&uacute;ng ta cảm gi&aacute;c trẻ trung, tuỳ v&agrave;o mỗi thiết kế v&agrave; chất liệu, c&aacute;ch thức trang tr&iacute; kh&aacute;c nhau m&agrave; m&agrave;u xanh c&oacute; thể l&agrave;m cho bạn c&aacute; t&iacute;nh, c&oacute; thể nổi bật hoặc cũng c&oacute; thể sang trọng....', 'media/wysiwyg/vay-da-hoi-xanh.jpg', 2, 1, NULL, 0, 1, 25, 0, '2018-03-11 21:54:31', '2018-03-11 22:04:39', 1, 1),
