(64, 'Georges Hobeika Fall winter 2016 2017 collection', 'georges-hobeika-fall-winter-2016-2017-collection', 'georges hobeika fall winter 2016 2017 collection', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/georges-hobeika-fall-winter-2016-2017-collection/', '<span>Bringing together the precious essence of creativity and the ease of incomparable craftsmanship, GEORGES HOBEIKA infuses into his Fall-Winter 2016-17 Haute Couture collection the virtue of peace contained in heavenly lanterns flying high into the starry evening and spreading, in a bright twinkle, their message of love and harmony.</span>', 'https://c1.staticflickr.com/9/8793/27808590523_b300c9b87e_o.jpg', 2, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:54:43', '2018-03-11 22:05:17', 1, 1),
(65, 'Cao cấp và sexy với BST Charbel Zoé Spring summer 2016', 'cao-cap-va-sexy-voi-bst-charbel-zoe-spring-summer-2016', 'cao cap va sexy voi bst charbel zoe spring summer 2016', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/cao-cap-va-sexy-voi-bst-charbel-zoe-spring-summer-2016/', 'BST Charbel Zoe Spring summer 2016 lần n&agrave;y mang đến sự gợi cảm v&ocirc; bờ bế, c&aacute;c thiết kế v&aacute;y dạ hội tinh tế v&agrave; tỉ mỉ, những đường cắt kho&eacute;t t&aacute;o bạo...', 'https://c1.staticflickr.com/9/8181/28076624664_14e8e3ab3c_o.jpg', 2, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:54:43', '2018-03-11 22:05:17', 1, 1),
(66, 'BST váy dạ hội cao cấp Fall 2016 của Zuhair Murad', 'bst-vay-da-hoi-cao-cap-fall-2016-cua-zuhair-murad', 'bst vay da hoi cao cap fall 2016 cua zuhair murad', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/bst-vay-da-hoi-cao-cap-fall-2016-cua-zuhair-murad/', 'C&oacute; lẽ bạn đ&atilde; kh&ocirc;ng c&ograve;n qu&aacute; xa lạ với những thiết kế v&aacute;y dạ hội v&agrave; &aacute;o cưới cao cấp từ NTK Zuhair Murad nổi tiếng tr&ecirc;n thế giới, v&agrave; năm nay BST Fall 2016 Couture của &ocirc;ng một lần nữa được tỏa s&aacute;ng...', 'https://c1.staticflickr.com/9/8223/28229268413_c0fff39eda_o.jpg', 2, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:54:43', '2018-03-11 22:05:17', 1, 1),
(67, 'Váy dạ hội sang trọng 2017 có thiết kế cao cấp', 'vay-da-hoi-sang-trong-2017-co-thiet-ke-cao-cap', 'vay da hoi sang trong 2017 co thiet ke cao cap', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/vay-da-hoi-sang-trong-2017-co-thiet-ke-cao-cap/', 'Thiết kế đơn giản, những mẫu v&aacute;y dạ hội sang trọng 2017 Resort của Georges Hobeika lu&ocirc;n mang đến cho người mặc sự kh&aacute;c biệt về sự cao cấp v&agrave; tinh tế...', 'media/wysiwyg/hob-blog.jpg', 2, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:54:43', '2018-03-11 22:05:17', 1, 1),
(68, 'Những mẫu váy phù dâu đẹp và sang trọng 2016', 'nhung-mau-vay-phu-dau-dep-va-sang-trong-2016', 'nhung mau vay phu dau dep va sang trong 2016', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/nhung-mau-vay-phu-dau-dep-va-sang-trong-2016/', 'Đi c&ugrave;ng với c&ocirc; d&acirc;u l&agrave; những c&ocirc; n&agrave;ng với những chiếc <strong>v&aacute;y ph&ugrave; d&acirc;u</strong> xinh xắn c&ugrave;ng tone, thường th&igrave; v&aacute;y phụ d&acirc;u sẽ tr&ugrave;ng với m&agrave;u của đ&aacute;m cưới, v&agrave; kh&aacute;c với m&agrave;u &aacute;o cưới của c&ocirc; d&acirc;u...', 'media/wysiwyg/2016/da-hoi/vay-phu-dau.jpg', 2, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:54:43', '2018-03-11 22:05:20', 1, 1),
(69, 'Mẫu đầm dạ hội đơn giản nhưng sang trọng 2017', 'mau-dam-da-hoi-don-gian-nhung-sang-trong-2017', 'mau dam da hoi don gian nhung sang trong 2017', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/mau-dam-da-hoi-don-gian-nhung-sang-trong-2017/', 'Những thiết kế v&aacute;y dạ hội kh&ocirc;ng qu&aacute; cầu kỳ, lấp l&aacute;nh bởi cườm đ&aacute; nhưng lại mang lại sự sang trọng, tinh tế v&agrave; thanh lịch cho người mặc, với những chất liệu cao cấp...', 'media/wysiwyg/2016/da-hoi/san-blog.jpg', 2, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:54:43', '2018-03-11 22:05:20', 1, 1),
(70, 'Váy dạ hội cao cấp Haute couture Fall winter 2016 2017', 'vay-da-hoi-cao-cap-haute-couture-fall-winter-2016-2017', 'vay da hoi cao cap haute couture fall winter 2016 2017', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/vay-da-hoi-cao-cap-haute-couture-fall-winter-2016-2017/', 'Nằm trong BST mới nhất của thương hiệu Ziad Nakad, những mẫu v&aacute;y dạ hội được sử dụng những chất liệu cao cấp, đ&iacute;nh kết tỉ mỉ thủ c&ocirc;ng từng họa tiết l&agrave;m cho BST trở n&ecirc;n lộng lẫy hơn', 'media/wysiwyg/2016/da-hoi/vay-dep-blog.jpg', 2, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:54:43', '2018-03-11 22:05:20', 1, 1),
(71, 'Mẫu váy dạ hội cao cấp thiết kế mới nhất 2017', 'mau-vay-da-hoi-cao-cap-thiet-ke-moi-nhat-2017', 'mau vay da hoi cao cap thiet ke moi nhat 2017', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/mau-vay-da-hoi-cao-cap-thiet-ke-moi-nhat-2017/', 'V&aacute;y dạ hội cao cấp mới nhất 2017 vừa được thương hiệu Pronovias cho ra đời, kh&ocirc;ng c&ograve;n xa lạ với những thiết kế sang trọng, nh&atilde; nhặn v&agrave; cao cấp của thương hiệu n&agrave;y...', 'media/wysiwyg/2016/da-hoi/dep-blog.jpg', 2, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:54:43', '2018-03-11 22:05:20', 1, 1),
(72, 'Tổng hợp những mẫu váy dạ hội cao cấp 2017', 'tong-hop-nhung-mau-vay-da-hoi-cao-cap-2017', 'tong hop nhung mau vay da hoi cao cap 2017', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/tong-hop-nhung-mau-vay-da-hoi-cao-cap-2017/', 'LAHAV sẽ tổng hợp những thiết kế v&aacute;y dạ hội si&ecirc;u cao cấp nằm trong những BST mới nhất đầu năm 2017 của c&aacute;c nh&agrave; thiết kế nổi tiếng tr&ecirc;n thế giới, c&aacute;c thiết kế n&agrave;y đều l&agrave; những thiết kế haute couture', 'media/wysiwyg/2016/da-hoi/cao-cap-blog.jpg', 2, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:54:43', '2018-03-11 22:05:23', 1, 1),
(73, 'BST Váy dạ hội Haute couture 2016 2017 Paolo Sebastian', 'bst-vay-da-hoi-haute-couture-2016-2017-paolo-sebastian', 'bst vay da hoi haute couture 2016 2017 paolo sebastian', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/bst-vay-da-hoi-haute-couture-2016-2017-paolo-sebastian/', 'Paolo Sebastian nổi tiếng với những thiết kế cao cấp v&agrave; lộng lẫy, AW 2016 2017 lần n&agrave;y cũng l&agrave; những thiết kế tinh tế, cầu kỳ v&agrave; thủ c&ocirc;ng, mang lại sự quyến rũ v&agrave; cuốn h&uacute;t...', 'media/wysiwyg/2016/da-hoi/pao-blog.jpg', 2, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:54:45', '2018-03-11 22:05:23', 1, 1),
(74, 'BST váy dự tiệc cao cấp 2017 Edward Arsouni Haute couture', 'bst-vay-du-tiec-cao-cap-2017-edward-arsouni-haute-couture', 'bst vay du tiec cao cap 2017 edward arsouni haute couture', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/bst-vay-du-tiec-cao-cap-2017-edward-arsouni-haute-couture/', 'Nằm trong BST Haute couture 2017 của Edward Arsouni, những thiết kế đầm dạ hội cao cấp với c&aacute;c chất liệu được xử l&yacute; tinh tế v&agrave; tỉ mỉ, đơn giản v&agrave; sang trọng c&oacute; thể khiến bất cứ c&ocirc; g&aacute;i n&agrave;o cũng ước mơ được kho&aacute;c l&ecirc;n người d&ugrave; chỉ một lần...', 'media/wysiwyg/2016/da-hoi/vay-du-tiec-blog.jpg', 2, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:54:45', '2018-03-11 22:05:23', 1, 1),
(75, 'Mẫu váy dạ hội trơn có thiết kế ấn tượng 2017', 'mau-vay-da-hoi-tron-co-thiet-ke-an-tuong-2017', 'mau vay da hoi tron co thiet ke an tuong 2017', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/mau-vay-da-hoi-tron-co-thiet-ke-an-tuong-2017/', 'Nếu bạn th&iacute;ch phong c&aacute;ch đơn giản, nhẹ nh&agrave;ng nhưng tinh tế, th&igrave; đ&acirc;y l&agrave; những mẫu v&aacute;y như vậy, những mẫu v&aacute;y chỉ tập trung v&agrave;o xử l&yacute; chất liệu cũng như kỹ thuật m&agrave; vẫn sang trọng...', 'media/wysiwyg/2016/da-hoi/vay-tron-blog.jpg', 2, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:54:45', '2018-03-11 22:05:23', 1, 1),
(76, 'những thiết kế váy dạ hội mượt mà 2017', 'nhung-thiet-ke-vay-da-hoi-muot-ma-2017', 'nhung thiet ke vay da hoi muot ma 2017', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/nhung-thiet-ke-vay-da-hoi-muot-ma-2017/', 'Những mẫu thiết kế v&aacute;y dạ hội đu&ocirc;i c&aacute; mượt m&agrave; v&agrave; quyến rũ lu&ocirc;n l&agrave; phong c&aacute;ch của Janique, kh&ocirc;ng qu&aacute; rườm r&agrave; cườm đ&aacute; nhưng chiếc v&aacute;y n&agrave;y v&agrave; rất nổi bật', 'media/wysiwyg/2016/da-hoi/jan-blog.jpg', 2, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:54:45', '2018-03-11 22:05:23', 1, 1);
