(77, 'Những mẫu váy dạ hội màu đen sang trọng và quyến rũ', 'nhung-mau-vay-da-hoi-mau-den-sang-trong-va-quyen-ru', 'nhung mau vay da hoi mau den sang trong va quyen ru', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/nhung-mau-vay-da-hoi-mau-den-sang-trong-va-quyen-ru/', 'Đầm v&aacute;y dạ hội m&agrave;u đen c&oacute; sức cuốn h&uacute;t v&agrave; sang trọng kh&aacute;c biệt, những thiết kế v&aacute;y dạ hội m&agrave;u đen n&agrave;y của Berta một lần nữa l&agrave;m cho c&aacute;c t&iacute;n đồ thời trang th&ecirc;m m&ecirc; mẩn thương hiệu đ&igrave;nh đ&aacute;m n&agrave;y', 'media/wysiwyg/2016/da-hoi/dahoi-blog.jpg', 2, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:54:45', '2018-03-11 22:05:23', 1, 1),
