(79, 'Đầm dự tiệc cao cấp với thiết kế đơn giản sang trọng', 'dam-du-tiec-cao-cap-voi-thiet-ke-don-gian-sang-trong', 'dam du tiec cao cap voi thiet ke don gian sang trong', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/dam-du-tiec-cao-cap-voi-thiet-ke-don-gian-sang-trong/', 'Những thiết kế chững chạc, sang trọng v&agrave; tinh tế lu&ocirc;n được St. Patrick hướng đến, những chất liệu cao cấp nhưng ren được xử l&yacute; thủ c&ocirc;ng l&agrave;m cho trang phục trở n&ecirc;n mềm mại v&agrave; đẳng cấp...', 'media/wysiwyg/dahoidep-blog.jpg', 2, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:54:45', '2018-03-11 22:05:25', 1, 1),
(80, 'Những mẫu váy dạ hội cho mẹ cô dâu 2017 sang trọng', 'nhung-mau-vay-da-hoi-cho-me-co-dau-2017-sang-trong', 'nhung mau vay da hoi cho me co dau 2017 sang trong', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/nhung-mau-vay-da-hoi-cho-me-co-dau-2017-sang-trong/', 'Những thiết kế v&aacute;y dạ hội cho mẹ c&ocirc; d&acirc;u mới nhất 2017 sau đ&acirc;y sẽ cho bạn c&aacute;i nh&igrave;n kh&aacute;c hơn, mới mẻ v&agrave; hiện đại hơn của thương hiệu thời trang Cameron Blake', 'media/wysiwyg/2016/da-hoi/me-co-dau-blog.jpg', 2, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:54:45', '2018-03-11 22:05:25', 1, 1),
(81, 'BST váy dạ hội cao cấp Fall 2017 của Berta', 'bst-vay-da-hoi-cao-cap-fall-2017-cua-berta', 'bst vay da hoi cao cap fall 2017 cua berta', 'https://www.lahava.vn/blog/cat/trang-phuc-da-hoi/post/bst-vay-da-hoi-cao-cap-fall-2017-cua-berta/', 'Khi nhắc đến thương hiệu Berta, c&oacute; lẽ người ta đ&atilde; qu&aacute; quen thuộc với những thiết kế v&aacute;y cưới quyến rũ v&agrave; lộng lẫy, nhưng b&ecirc;n cạnh đ&oacute;, c&aacute;c thiết kế v&aacute;y dạ hội cũng kh&ocirc;ng hề k&eacute;m cạnh.', 'media/wysiwyg/2016/da-hoi/vadahoi-ber0blog.jpg', 2, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:54:45', '2018-03-11 22:05:25', 1, 1),
