(107, 'Sang trọng và quyến rũ với BST áo cưới thiết kế đẹp 2015', 'sang-trong-va-quyen-ru-voi-bst-ao-cuoi-thiet-ke-dep-2015', 'sang trong va quyen ru voi bst ao cuoi thiet ke dep 2015', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/sang-trong-va-quyen-ru-voi-bst-ao-cuoi-thiet-ke-dep-2015/', 'Những mẫu <strong>&aacute;o cưới thiết kế</strong> với c&aacute;c chất liệu quen thuộc như ren, lưới mềm, cườm pha l&ecirc;...nhưng với &yacute; tưởng kh&aacute;c, nh&agrave; thiết kế La Sposa đ&atilde; cho ra BST v&aacute;y cưới thật cao cấp v&agrave; lộng lẫy....', 'media/wysiwyg/ao-cuoi-thiet-ke-blog.jpg', 3, 1, NULL, 0, 1, 34, 0, '2018-03-11 21:56:52', '2018-03-11 22:04:42', 1, 1),
(108, 'Những mẫu áo cưới xoè nhẹ nhàng đơn giản nhưng sang trọng', 'nhung-mau-ao-cuoi-xoe-nhe-nhang-don-gian-nhung-sang-trong', 'nhung mau ao cuoi xoe nhe nhang don gian nhung sang trong', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/nhung-mau-ao-cuoi-xoe-nhe-nhang-don-gian-nhung-sang-trong/', 'Những mẫu <a href=\"http://www.lahava.vn/may-ao-cuoi-dep.html\">&aacute;o cưới</a> được thiết kế đơn giản nhưng sang trọng với t&ugrave;ng A xo&egrave; nhẹ, kết trang tr&iacute; ren v&agrave; điểm hạt s&aacute;ng lấp l&aacute;nh với c&aacute;c chất liệu như lưới, organza v&agrave; ren th&ecirc;u cao cấp...', 'media/wysiwyg/ao-cuoi-xoe-dep-blog.jpg', 3, 1, NULL, 0, 1, 38, 0, '2018-03-11 21:56:52', '2018-03-11 22:04:46', 1, 1),
