(147, 'Noya bridal 2016 Aria collection', 'noya-bridal-2016-aria-collection', 'noya bridal 2016 aria collection', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/noya-bridal-2016-aria-collection/', 'Bạn đ&atilde; sẵn s&agrave;ng mở tiệc cho mắt của bạn chưa? Ok h&atilde;y c&ugrave;ng nhau mơ mộng với những thiết kế v&aacute;y v&ocirc; c&ugrave;ng tinh tế v&agrave; đ&aacute;ng y&ecirc;u 2016 của Noya bridal', 'https://c2.staticflickr.com/8/7218/27514025615_6410fe417c_o.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:56:59', '2018-03-11 22:05:15', 1, 1),
(148, 'Bộ sưu tập váy cưới gợi cảm nhè nhàng của Mira Zwillinger', 'bo-suu-tap-vay-cuoi-goi-cam-nhe-nhang-cua-mira-zwillinger', 'bo suu tap vay cuoi goi cam nhe nhang cua mira zwillinger', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/bo-suu-tap-vay-cuoi-goi-cam-nhe-nhang-cua-mira-zwillinger/', 'BST v&aacute;y cưới 2017 của MZ tinh tế v&agrave; huyền diệu, từng đường n&eacute;t nhẹ nh&agrave;ng thanh mảnh quyến rũ, thật tuyệt vời để kho&aacute;c l&ecirc;n m&igrave;nh chiếc v&aacute;y gợi cảm như vậy....', 'https://c2.staticflickr.com/8/7301/27754194096_557b908440_o.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:56:59', '2018-03-11 22:05:15', 1, 1),
(149, 'BST áo cưới cao cấp 2017 của Idan Cohen', 'bst-ao-cuoi-cao-cap-2017-cua-idan-cohen', 'bst ao cuoi cao cap 2017 cua idan cohen', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/bst-ao-cuoi-cao-cap-2017-cua-idan-cohen/', 'Cao cấp, ấn tượng v&agrave; s&aacute;ng tạo, những mẫu &aacute;o cưới nằm trong bộ sưu tập 2017 của Idan Cohen đ&atilde; rất quyến rũ v&agrave; m&ecirc; hoặc những t&iacute;n đồ thời trang, BST như l&agrave; một lời ch&agrave;o ngọt ng&agrave;o th&aacute;ng 7', 'https://c2.staticflickr.com/8/7260/27438189484_f16b324acc_o.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:56:59', '2018-03-11 22:05:15', 1, 1),
(150, 'Áo cưới ren nữ tính và sang trọng 2017 của Eddy K', 'ao-cuoi-ren-nu-tinh-va-sang-trong-2017-cua-eddy-k', 'ao cuoi ren nu tinh va sang trong 2017 cua eddy k', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/ao-cuoi-ren-nu-tinh-va-sang-trong-2017-cua-eddy-k/', 'Được chụp tại Milano nơi kinh đ&ocirc; thời trang tr&aacute;ng lệ của &Yacute;, BST &aacute;o cưới mới nhất 2017 của Eddy K đ&atilde; thật sự mang lại những cảm x&uacute;c kh&aacute;c biệt, kh&ocirc;ng qu&aacute; cầu kỳ v&agrave; sắc m&agrave;u nhưng vẫn đủ để mềm mại v&agrave; ấn tượng...', 'https://c1.staticflickr.com/9/8791/28453122341_485c1d56fc_o.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:56:59', '2018-03-11 22:05:17', 1, 1),
(151, 'Mẫu áo cưới xòe công chúa đẹp 2017 của Nicole', 'mau-ao-cuoi-xoe-cong-chua-dep-2017-cua-nicole', 'mau ao cuoi xoe cong chua dep 2017 cua nicole', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/mau-ao-cuoi-xoe-cong-chua-dep-2017-cua-nicole/', 'Những thiết kế nằm trong BST mới nhất 2017 của thương hiệu Nicole, kh&ocirc;ng qu&aacute; lấp l&aacute;nh v&agrave; nổi bật nhưng những thiết kế v&aacute;y cưới x&ograve;e n&agrave;y lại được rất nhiều c&ocirc; d&acirc;u lựa chọn hiện nay...', 'https://c1.staticflickr.com/9/8753/28630678202_6ab10f02bc_o.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:57:01', '2018-03-11 22:05:17', 1, 1),
(152, 'Mẫu váy cưới đơn giản nhẹ nhàng nhưng sang trọng', 'mau-vay-cuoi-don-gian-nhe-nhang-nhung-sang-trong', 'mau vay cuoi don gian nhe nhang nhung sang trong', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/mau-vay-cuoi-don-gian-nhe-nhang-nhung-sang-trong/', 'Những thiết kế v&aacute;y cưới đơn giản, nh&egrave; nh&agrave;ng nhưng sang trọng của Moonlight Bridal lu&ocirc;n l&agrave; sự lựa chọn của những c&ocirc; d&acirc;u th&iacute;ch sự tinh tế hơn l&agrave; nổi bật...', 'https://c1.staticflickr.com/9/8251/28874561736_9bcae84ab9_o.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:57:01', '2018-03-11 22:05:17', 1, 1);
