(153, 'Mẫu áo cưới đuôi cá đẹp và quyến rũ cho cô dâu', 'mau-ao-cuoi-duoi-ca-dep-va-quyen-ru-cho-co-dau', 'mau ao cuoi duoi ca dep va quyen ru cho co dau', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/mau-ao-cuoi-duoi-ca-dep-va-quyen-ru-cho-co-dau/', 'Nếu c&ocirc; d&acirc;u đang t&igrave;m kiếm cho m&igrave;nh mẫu <strong>v&aacute;y cưới đu&ocirc;i c&aacute;</strong> vừa nhẹ nh&agrave;ng v&agrave; gợi cảm th&igrave; những thiết kế v&aacute;y đu&ocirc;i c&aacute; sau của Sophia Tolli sẽ cho bạn th&ecirc;m những gợi &yacute; tuyệt vời...', 'media/wysiwyg/so-blog.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:57:01', '2018-03-11 22:05:17', 1, 1),
(154, 'Mẫu áo cưới thiết kế ngọt ngào và quyến rũ cho cô dâu', 'mau-ao-cuoi-thiet-ke-ngot-ngao-va-quyen-ru-cho-co-dau', 'mau ao cuoi thiet ke ngot ngao va quyen ru cho co dau', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/mau-ao-cuoi-thiet-ke-ngot-ngao-va-quyen-ru-cho-co-dau/', 'BST v&aacute;y cưới cao cấp 2017 của Alessandra Rinaudo mang lại sự l&atilde;ng mạn v&agrave; sang trọng, c&aacute;c thiết kế trong BST của thương hiệu đến từ &Yacute; được chăm ch&uacute;t rất tỉ mỉ với c&aacute;c họa tiết đẹp nhất...', 'media/wysiwyg/2016/vay-cuoi/ales-blog.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:57:01', '2018-03-11 22:05:20', 1, 1),
(155, 'Những thiết kế váy cưới đẹp tuyệt vời của Crystal', 'nhung-thiet-ke-vay-cuoi-dep-tuyet-voi-cua-crystal', 'nhung thiet ke vay cuoi dep tuyet voi cua crystal', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/nhung-thiet-ke-vay-cuoi-dep-tuyet-voi-cua-crystal/', 'Nếu như bạn đ&atilde; từng nghe đ&acirc;u đ&oacute; về thương hiệu thời trang Crystal th&igrave; chắc hẳn bạn sẽ rất ấn tượng với những thiết kế v&aacute;y cưới của thương hiệu n&agrave;y...', 'media/wysiwyg/2016/vay-cuoi/cry-blog.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:57:01', '2018-03-11 22:05:20', 1, 1),
(156, 'Váy cưới đuôi cá 2017 hiện đại và quyến rũ', 'vay-cuoi-duoi-ca-2017-hien-dai-va-quyen-ru', 'vay cuoi duoi ca 2017 hien dai va quyen ru', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/vay-cuoi-duoi-ca-2017-hien-dai-va-quyen-ru/', 'V&aacute;y cưới đu&ocirc;i c&aacute; lu&ocirc;n mang lại sự quyến rũ v&agrave; t&ocirc;n tạo v&oacute;c d&aacute;ng của c&aacute;c c&ocirc; d&acirc;u, v&agrave; đ&oacute; cũng l&agrave; l&yacute; do loại v&aacute;y cưới n&agrave;y được rất nhiều c&ocirc; d&acirc;u lựa chọn thay cho v&aacute;y cưới x&ograve;e c&ocirc;ng ch&uacute;a', 'media/wysiwyg/2016/vay-cuoi/julie-blog.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:57:01', '2018-03-11 22:05:20', 1, 1),
(157, 'Một số thiết kế váy cưới mới nhất trong BST Paloma Blanca', 'mot-so-thiet-ke-vay-cuoi-moi-nhat-trong-bst-paloma-blanca', 'mot so thiet ke vay cuoi moi nhat trong bst paloma blanca', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/mot-so-thiet-ke-vay-cuoi-moi-nhat-trong-bst-paloma-blanca/', 'Những mẫu v&aacute;y cưới vừa nhẹ nh&agrave;ng, đơn giản nhưng cực kỳ sang trọng của Paloma Blanca, những d&aacute;ng v&aacute;y đu&ocirc;i c&aacute; &ocirc;m s&aacute;t cơ thể sẽ gi&uacute;p cho c&ocirc; d&acirc;u t&ocirc;n tạo v&oacute;c d&aacute;ng hơn...', 'media/wysiwyg/2016/vay-cuoi/vaycuoi-blog.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:57:01', '2018-03-11 22:05:20', 1, 1),
(158, 'Xu hướng áo cưới đơn giản sang trọng 2017', 'xu-huong-ao-cuoi-don-gian-sang-trong-2017', 'xu huong ao cuoi don gian sang trong 2017', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/xu-huong-ao-cuoi-don-gian-sang-trong-2017/', 'Với những thiết kế đơn giản, sang trọng, những mẫu v&aacute;y cưới 2017 sau được nhiều NTK hướng đến trong năm nay, nếu bạn đang t&igrave;m cho m&igrave;nh chiếc &aacute;o cưới vừa nhẹ nh&agrave;ng nhưng quyến rũ....', 'media/wysiwyg/2016/vay-cuoi/ao-cuoi-blog.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:57:01', '2018-03-11 22:05:23', 1, 1),
(159, 'BST áo cưới cao cấp Berta Fall Winter 2016', 'bst-ao-cuoi-cao-cap-berta-fall-winter-2016', 'bst ao cuoi cao cap berta fall winter 2016', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/bst-ao-cuoi-cao-cap-berta-fall-winter-2016/', 'Berta Bridal Fall Winter 2016 được đầu tư kh&aacute; kỹ lưỡng, tất cả c&aacute;c mẫu v&aacute;y cưới được thiết kế tỉ mỉ về chất lượng cũng như kiểu d&aacute;ng, mang lại sự quyến rũ v&agrave; cao cấp từ mọi g&oacute;c nh&igrave;n.', 'media/wysiwyg/2016/vay-cuoi/berta-blog.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:57:01', '2018-03-11 22:05:23', 1, 1),
(160, 'Những thiết kế váy cưới quyến rũ 2017 của Naama Anat', 'nhung-thiet-ke-vay-cuoi-quyen-ru-2017-cua-naama-anat', 'nhung thiet ke vay cuoi quyen ru 2017 cua naama anat', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/nhung-thiet-ke-vay-cuoi-quyen-ru-2017-cua-naama-anat/', 'Những thiết kế v&aacute;y cưới 2017 qu&aacute; lộng lẫy v&agrave; quyến rũ, cũng giống như những BST trước, Naama Anat vẫn đi theo lối thiết kế cuốn h&uacute;t v&agrave; cao cấp của m&igrave;nh...', 'media/wysiwyg/2016/vay-cuoi/anat-blog.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:57:01', '2018-03-11 22:05:23', 1, 1),
(161, 'mẫu áo cưới cao cấp 2017 cho các cô dâu tham khảo', 'mau-ao-cuoi-cao-cap-2017-cho-cac-co-dau-tham-khao', 'mau ao cuoi cao cap 2017 cho cac co dau tham khao', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/mau-ao-cuoi-cao-cap-2017-cho-cac-co-dau-tham-khao/', 'Nếu ng&agrave;y trọng đại của bạn đang gần kề v&agrave; việc chọn lựa một chiếc v&aacute;y cưới cao cấp v&agrave; ph&ugrave; hợp bạn nhất l&agrave; một điều kh&oacute; th&igrave; những mẫu &aacute;o cưới đẹp 2017 sau sẽ cho bạn th&ecirc;m những gợi &yacute;...', 'media/wysiwyg/2016/vay-cuoi/mag-blog.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:57:01', '2018-03-11 22:05:25', 1, 1),
(162, 'Zuhair Murad Bridal Fall 2017 Haute couture collection', 'zuhair-murad-bridal-fall-2017-haute-couture-collection', 'zuhair murad bridal fall 2017 haute couture collection', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/zuhair-murad-bridal-fall-2017-haute-couture-collection/', 'Chắc hẳn bạn đ&atilde; kh&ocirc;ng c&ograve;n qu&aacute; xa lạ với nh&agrave; thiết kế t&agrave;i ba nổi tiếng tr&ecirc;n thế giới n&agrave;y, v&acirc;ng! đ&oacute; ch&iacute;nh l&agrave; Zuhair Murad, v&agrave; trong BST Fall 2017 n&agrave;y c&aacute;c bạn sẽ chờ đợi điều g&igrave;?', 'media/wysiwyg/2016/vay-cuoi/zuhair-blog.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:57:01', '2018-03-11 22:05:25', 1, 1),
(163, 'Những thiết kế áo cưới nhẹ nhàng nhưng cao cấp 2017', 'nhung-thiet-ke-ao-cuoi-nhe-nhang-nhung-cao-cap-2017', 'nhung thiet ke ao cuoi nhe nhang nhung cao cap 2017', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/nhung-thiet-ke-ao-cuoi-nhe-nhang-nhung-cao-cap-2017/', 'Cũng với phong c&aacute;ch thiết kế nhẹ nh&agrave;ng nhưng sang trọng, những mẫu v&aacute;y cưới cao cấp 2017 nằm trong BST couture của Riki Dalal một lần nữa l&agrave;m cho những c&ocirc; d&acirc;u y&ecirc;u phong c&aacute;ch n&agrave;y phải ngắm nh&igrave;n..,', 'media/wysiwyg/2016/vay-cuoi/riki-blog.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:57:04', '2018-03-11 22:05:25', 1, 1),
(164, 'Nét sáng tạo trong thiết kế váy cưới cao cấp 2017', 'net-sang-tao-trong-thiet-ke-vay-cuoi-cao-cap-2017', 'net sang tao trong thiet ke vay cuoi cao cap 2017', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/net-sang-tao-trong-thiet-ke-vay-cuoi-cao-cap-2017/', 'Berta vừa tung ra BST v&aacute;y cưới cao cấp Fall 2017 mới nhất với những n&eacute;t thiết kế gợi cảm, tinh tế quen thuộc, được sử dụng với c&aacute;c chất liệu cao cấp...', 'media/wysiwyg/2016/vay-cuoi/berta-fall-2017.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:57:04', '2018-03-11 22:05:28', 1, 1),
(165, 'Váy cưới đuôi cá cao cấp 2017 của Calla Blanche', 'vay-cuoi-duoi-ca-cao-cap-2017-cua-calla-blanche', 'vay cuoi duoi ca cao cap 2017 cua calla blanche', 'https://www.lahava.vn/blog/cat/trang-phuc-cuoi/post/vay-cuoi-duoi-ca-cao-cap-2017-cua-calla-blanche/', 'Calla Blanche l&agrave; một thương hiệu mới đến từ Canada, những thiết kế của CB hướng đến sự gợi cảm, cao cấp v&agrave; sang trọng với chất liệu ren th&ecirc;u mềm mại, d&aacute;ng v&aacute;y mượt m&agrave;.', 'media/wysiwyg/2017/wedding-dress/calla-blog.jpg', 3, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:57:04', '2018-03-11 22:05:28', 1, 1),
