(224, 'Những thiết kế áo dài hoa đằm thắm và tươi trẻ', 'nhung-thiet-ke-ao-dai-hoa-dam-tham-va-tuoi-tre', 'nhung thiet ke ao dai hoa dam tham va tuoi tre', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/nhung-thiet-ke-ao-dai-hoa-dam-tham-va-tuoi-tre/', 'Những thiết kế &aacute;o d&agrave;i hoa bao giờ cũng mang lại cho người mặc sự dịu d&agrave;ng, đằm thắm v&agrave; trẻ trung, c&aacute;c họa tiết hoa như t&ocirc; vẻ những n&eacute;t đẹp truyền thống của người con g&aacute;i Việt.', 'https://c2.staticflickr.com/8/7292/26721674151_76fdc8b54a_o.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:51', '2018-03-11 22:05:12', 1, 1),
(225, 'Duyên dáng với áo cách điệu kết ren và thêu tay', 'duyen-dang-voi-ao-cach-dieu-ket-ren-va-theu-tay', 'duyen dang voi ao cach dieu ket ren va theu tay', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/duyen-dang-voi-ao-dai-cach-dieu-ket-ren-va-theu-tay/', 'Những mẫu &aacute;o d&agrave;i c&aacute;ch t&acirc;n nổi bật với c&aacute;c họa tiết tươi trẻ, những c&aacute;nh hoa được thiết kế v&agrave; đ&iacute;nh kết một c&aacute;ch tỉ mỉ nổi bật nhưng kh&ocirc;ng qu&aacute; ch&oacute;i đ&atilde; l&agrave;m cho những mẫu &aacute;o d&agrave;i n&agrave;y ấn tượng hơn.', 'https://c2.staticflickr.com/8/7418/26847544845_9eed05aac7_o.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:51', '2018-03-11 22:05:12', 1, 1),
(226, 'Những mẫu áo dài nam lịch lãm và sang trọng', 'nhung-mau-ao-dai-nam-lich-lam-va-sang-trong', 'nhung mau ao dai nam lich lam va sang trong', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/nhung-mau-ao-dai-nam-lich-lam-va-sang-trong/', 'Những mẫu &aacute;o d&agrave;i cưới nam được vẽ trang tr&iacute; những họa tiết nổi bật v&agrave; sang trọng cho ch&uacute; rể, c&aacute;c thiết kế với form vest sẽ gi&uacute;p ch&uacute; rể tr&ocirc;ng mạnh mẽ v&agrave; nam t&iacute;nh hơn', 'media/wysiwyg/ao-dai-nam-dep-blog.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:51', '2018-03-11 22:05:12', 1, 1),
(227, 'Mẫu áo dài làm sui sang trọng và đẹp nhất 2016', 'mau-ao-dai-lam-sui-sang-trong-va-dep-nhat-2016', 'mau ao dai lam sui sang trong va dep nhat 2016', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/mau-ao-dai-lam-sui-sang-trong-va-dep-nhat-2016/', 'Một bộ trang phục vừa vặn v&agrave; ph&ugrave; hợp với m&igrave;nh trong ng&agrave;y trọng đại của con c&aacute;i lu&ocirc;n l&agrave; điều quan trọng nhất của những người l&agrave;m mẹ, bởi sau c&ocirc; d&acirc;u ch&uacute; rể th&igrave; cha mẹ l&agrave; người được ch&uacute; &yacute; đến nhiều nhất.', 'https://c2.staticflickr.com/8/7797/27002775560_5cc8414771_o.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:51', '2018-03-11 22:05:15', 1, 1);
