(228, 'Áo dài vàng thiết kế rực rỡ với những họa tiết đẹp', 'ao-dai-vang-thiet-ke-ruc-ro-voi-nhung-hoa-tiet-dep', 'ao dai vang thiet ke ruc ro voi nhung hoa tiet dep', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/ao-dai-vang-thiet-ke-ruc-ro-voi-nhung-hoa-tiet-dep/', 'Ng&agrave;y nay, &aacute;o d&agrave;i cưới kh&ocirc;ng chỉ l&agrave; những t&ocirc;ng m&agrave;u quen thuộc như đỏ, trắng, hồng...m&agrave; n&oacute; c&oacute; thể l&agrave; m&agrave;u v&agrave;ng hoặc bất cứ m&agrave;u n&agrave;o bạn th&iacute;ch, bạn cảm thấy m&igrave;nh xinh đẹp trẻ trung với thiết kế m&igrave;nh đ&atilde; chọn', 'https://c2.staticflickr.com/8/7377/26946770684_8f6e42f323_o.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:51', '2018-03-11 22:05:15', 1, 1),
(229, 'Một số gợi ý áo dài cho tân nương tươi trẻ hơn', 'mot-so-goi-y-ao-dai-cho-tan-nuong-tuoi-tre-hon', 'mot so goi y ao dai cho tan nuong tuoi tre hon', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/mot-so-goi-y-ao-dai-cho-tan-nuong-tuoi-tre-hon/', 'Một số thiết kế mới trong &aacute;o d&agrave;i cưới bạn c&oacute; thể tham khảo, những họa tiết được vẽ v&agrave; trang tr&iacute; một c&aacute;ch tỉ mỉ, trau chuốt...sẽ gi&uacute;p t&acirc;n nương tr&ocirc;ng nổi bật v&agrave; ấn tượng hơn', 'https://c2.staticflickr.com/8/7047/27031748343_e81a88c569_o.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:53', '2018-03-11 22:05:15', 1, 1),
(230, 'Những thiết kế áo dài cưới trắng cho tân nương', 'nhung-thiet-ke-ao-dai-cuoi-trang-cho-tan-nuong', 'nhung thiet ke ao dai cuoi trang cho tan nuong', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/nhung-thiet-ke-ao-dai-cuoi-trang-cho-tan-nuong/', '&Aacute;o d&agrave;i cưới trắng lu&ocirc;n l&agrave; lựa chọn ưu ti&ecirc;n của c&aacute;c c&ocirc; d&acirc;u, sự tinh khiết với n&eacute;t trong s&aacute;ng v&agrave; kh&ocirc;ng k&eacute;n l&agrave;n da l&agrave; những l&yacute; do của m&agrave;u sắc n&agrave;y lu&ocirc;n được ưu &aacute;i.', 'https://c2.staticflickr.com/8/7449/27592134960_67a6414619_o.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:53', '2018-03-11 22:05:15', 1, 1),
(231, 'Áo dài cưới hồng da cho tân nương xinh đẹp', 'ao-dai-cuoi-hong-da-cho-tan-nuong-xinh-dep', 'ao dai cuoi hong da cho tan nuong xinh dep', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/ao-dai-cuoi-hong-da-cho-tan-nuong-xinh-dep/', 'Những mẫu &aacute;o d&agrave;i cưới m&agrave;u hồng da lu&ocirc;n được c&aacute;c t&acirc;n nương ưa chuộng, với sự thanh lịch, nhẹ nh&agrave;ng v&agrave; t&ocirc;n da, c&aacute;c mẫu &aacute;o d&agrave;i hồng da lu&ocirc;n l&agrave; sự lựa chọn...', 'https://c2.staticflickr.com/8/7284/28322287665_59c384d581_o.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:53', '2018-03-11 22:05:17', 1, 1),
(232, 'Tân nương trẻ trung và nổi bật với áo dài vẽ', 'tan-nuong-tre-trung-va-noi-bat-voi-ao-dai-ve', 'tan nuong tre trung va noi bat voi ao dai ve', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/tan-nuong-tre-trung-va-noi-bat-voi-ao-dai-ve/', '&Aacute;o d&agrave;i cưới vẽ lu&ocirc;n mang lại cho t&acirc;n nương một sự kh&aacute;c biệt, một sự đồng điệu giữa c&ocirc; d&acirc;u v&agrave; ch&uacute; rể, một th&ocirc;ng điệp hạnh ph&uacute;c m&agrave; những họa tiết tr&ecirc;n &aacute;o mang lại...', 'https://c1.staticflickr.com/9/8119/28479345131_fb0d9af101_o.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:53', '2018-03-11 22:05:17', 1, 1),
(233, 'Tổng hợp những mẫu áo dài cưới đẹp 2016 LAHAVA', 'tong-hop-nhung-mau-ao-dai-cuoi-dep-2016-lahava', 'tong hop nhung mau ao dai cuoi dep 2016 lahava', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/tong-hop-nhung-mau-ao-dai-cuoi-dep-2016-lahava/', 'Tổng hợp một số mẫu &aacute;o d&agrave;i cưới c&oacute; thiết kế đẹp v&agrave; nổi bật 2016 của LAHAVA, ch&uacute;ng t&ocirc;i chuy&ecirc;n về &aacute;o d&agrave;i cưới, &aacute;o d&agrave;i trung ni&ecirc;n v&agrave; &aacute;o d&agrave;i nam c&aacute;ch t&acirc;n...', 'media/wysiwyg/lahava-blog.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:53', '2018-03-11 22:05:17', 1, 1),
(234, 'Mẫu áo dài lụa cho cô dâu thêm xinh xắn', 'mau-ao-dai-lua-cho-co-dau-them-xinh-xan', 'mau ao dai lua cho co dau them xinh xan', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/mau-ao-dai-lua-cho-co-dau-them-xinh-xan/', 'Khi nhắc đến &aacute;o d&agrave;i cưới, ch&uacute;ng ta sẽ nghĩ ngay đến những chất liệu như ren, chiffon, voan... v&agrave; đặc biệt l&agrave; lụa. Kh&ocirc;ng qu&aacute; cầu kỳ, những mẫu &aacute;o d&agrave;i lụa tươi tắn gi&uacute;p cho c&ocirc; d&acirc;u trở n&ecirc;n duy&ecirc;n d&aacute;ng hơn...', 'media/wysiwyg/lua-blog.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:53', '2018-03-11 22:05:17', 1, 1),
(235, 'Mẫu áo dài nam cách tân 2017 với thiết kế sáng tạo', 'mau-ao-dai-nam-cach-tan-2017-voi-thiet-ke-sang-tao', 'mau ao dai nam cach tan 2017 voi thiet ke sang tao', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/mau-ao-dai-nam-cach-tan-2017-voi-thiet-ke-sang-tao/', 'Những mẫu <strong>&aacute;o d&agrave;i nam 2017</strong> với thiết kế ấn tượng v&agrave; nổi bật, được thiết kế c&aacute;ch t&acirc;n từ mẫu &aacute;o d&agrave;i truyền thống, &aacute;o d&agrave;i nam trở n&ecirc;n hiện đại v&agrave; trẻ trung hơn rất nhiều, c&ugrave;ng tham khảo một số thiết kế &aacute;o d&agrave;i nam ấn tượng...', 'media/wysiwyg/ao-dai-nam-cach-tan.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:53', '2018-03-11 22:05:20', 1, 1),
(236, 'Những thiết kế áo dài hoa dịu dàng và nữ tính', 'nhung-thiet-ke-ao-dai-hoa-diu-dang-va-nu-tinh', 'nhung thiet ke ao dai hoa diu dang va nu tinh', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/nhung-thiet-ke-ao-dai-hoa-diu-dang-va-nu-tinh/', '&Aacute;o d&agrave;i in họa tiết hoa đ&atilde; được xem như truyền thống từ xa xưa, &aacute;o d&agrave;i thường đường thiết kế những họa tiết hoa hoặc &aacute;o d&agrave;i trơn, ng&agrave;y nay &aacute;o d&agrave;i được c&aacute;ch t&acirc;n với ren, cườm đ&aacute;...', 'media/wysiwyg/2016/ao-dai/ao-dai-hoa-blog.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:53', '2018-03-11 22:05:20', 1, 1),
(237, 'Những mẫu áo dài thêu tay cao cấp và tỉ mỉ', 'nhung-mau-ao-dai-theu-tay-cao-cap-va-ti-mi', 'nhung mau ao dai theu tay cao cap va ti mi', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/nhung-mau-ao-dai-theu-tay-cao-cap-va-ti-mi/', 'Nếu bạn kh&ocirc;ng th&iacute;ch sự lấp l&aacute;nh bởi cườm đ&aacute;, bạn kh&ocirc;ng th&iacute;ch phong c&aacute;ch hiện đại bởi những thiết kế &aacute;o d&agrave;i c&aacute;ch t&acirc;n, th&igrave; những mẫu &aacute;o d&agrave;i th&ecirc;u tay n&agrave;y sẽ d&agrave;nh ri&ecirc;ng cho bạn...', 'media/wysiwyg/2016/ao-dai/theu-blog.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:53', '2018-03-11 22:05:20', 1, 1),
(238, 'Mẫu áo dài vẽ trẻ trung và thanh lịch', 'mau-ao-dai-ve-tre-trung-va-thanh-lich', 'mau ao dai ve tre trung va thanh lich', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/mau-ao-dai-ve-tre-trung-va-thanh-lich/', 'C&ugrave;ng tham khảo một số mẫu &aacute;o d&agrave;i vẽ họa tiết tươi trẻ, mẫu &aacute;o d&agrave;i vẽ th&iacute;ch hợp cho bạn đi dự những sự kiện, vừa nhẹ nh&agrave;ng lại vừa thanh lịch.', 'media/wysiwyg/2016/ao-dai/ao-ve-blog.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:53', '2018-03-11 22:05:20', 1, 1),
(239, 'Mẫu áo dài đám hỏi đẹp và nhẹ nhàng cho cô dâu', 'mau-ao-dai-dam-hoi-dep-va-nhe-nhang-cho-co-dau', 'mau ao dai dam hoi dep va nhe nhang cho co dau', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/mau-ao-dai-dam-hoi-dep-va-nhe-nhang-cho-co-dau/', 'Những mẫu &aacute;o d&agrave;i c&oacute; thiết kế nhẹ nh&agrave;ng, thanh lịch với c&aacute;c t&ocirc;ng m&agrave;u như da, m&agrave;u v&agrave;ng nhạt hoặc m&agrave;u trắng thường hay được c&aacute;c c&ocirc; d&acirc;u chọn để mặc trong lễ gia ti&ecirc;n của m&igrave;nh', 'media/wysiwyg/2016/ao-dai/aodai-blog.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:53', '2018-03-11 22:05:23', 1, 1),
(240, 'Chia sẻ kinh nghiệm may áo dài cưới đẹp nhất', 'chia-se-kinh-nghiem-may-ao-dai-cuoi-dep-nhat', 'chia se kinh nghiem may ao dai cuoi dep nhat', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/chia-se-kinh-nghiem-may-ao-dai-cuoi-dep-nhat/', 'Cũng giống như những trang phục cưới kh&aacute;c, việc may &aacute;o d&agrave;i cưới như thế n&agrave;o để vừa tiết kiệm chi ph&iacute;, vừa đẹp v&agrave; sang trọng nhất lu&ocirc;n l&agrave; những vấn đề m&agrave; bất cứ c&ocirc; d&acirc;u n&agrave;o cũng lo lắng trước ng&agrave;y trọng đại của m&igrave;nh.', 'media/wysiwyg/2016/ao-dai/may-ao-dai.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:53', '2018-03-11 22:05:23', 1, 1),
(241, 'Những thiết kế áo dài trung niên sang trọng nhất', 'nhung-thiet-ke-ao-dai-trung-nien-sang-trong-nhat', 'nhung thiet ke ao dai trung nien sang trong nhat', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/nhung-thiet-ke-ao-dai-trung-nien-sang-trong-nhat/', 'Những thiết kế &aacute;o d&agrave;i trung ni&ecirc;n sang trọng cho qu&yacute; c&ocirc; lu&ocirc;n được c&aacute;c nh&agrave; thiết kế chọn những t&ocirc;ng m&agrave;u trầm v&agrave; nh&atilde; nhặn, kết hợp với họa tiết th&ecirc;u cao cấp v&agrave; cườm đ&aacute; điểm ...', 'media/wysiwyg/2016/ao-dai/ao-dai-trung-nien-blog.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:58', '2018-03-11 22:05:23', 1, 1),
(242, 'Áo dài cưới lấp lánh với họa tiết pha lê cao cấp', 'ao-dai-cuoi-lap-lanh-voi-hoa-tiet-pha-le-cao-cap', 'ao dai cuoi lap lanh voi hoa tiet pha le cao cap', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/ao-dai-cuoi-lap-lanh-voi-hoa-tiet-pha-le-cao-cap/', 'Mẫu &aacute;o d&agrave;i cưới nổi bật, lấp l&aacute;nh lu&ocirc;n l&agrave; mang lại sự tươi trẻ cho c&ocirc; d&acirc;u, c&aacute;c thiết kế tập trung v&agrave; họa tiết cườm đ&aacute; v&agrave; pha l&ecirc;, khi dưới anh đ&egrave;n mọi thứ sẽ trở n&ecirc;n lung linh...', 'media/wysiwyg/2016/ao-dai/aodaidep-blog.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:58', '2018-03-11 22:05:25', 1, 1),
(243, 'Một số gợi ý áo dài trung niên sang trọng', 'mot-so-goi-y-ao-dai-trung-nien-sang-trong', 'mot so goi y ao dai trung nien sang trong', 'https://www.lahava.vn/blog/cat/ao-dai-viet-nam/post/mot-so-goi-y-ao-dai-trung-nien-sang-trong/', 'Những thiết kế nhẹ nh&agrave;ng v&agrave; sang trọng rất ph&ugrave; hợp cho lứa tuổi trung ni&ecirc;n mặc đi sự kiện, dự tiệc...với những thiết kế n&agrave;y bạn sẽ trẻ trung v&agrave; hiện đại hơn...', 'media/wysiwyg/2016/ao-dai/trungnien-blog.jpg', 4, 1, NULL, 0, 1, 127, 0, '2018-03-11 21:58:58', '2018-03-11 22:05:25', 1, 1),
