INSERT INTO `text` (`id`, `content`) VALUES
(1, 'CÔNG TY TNHH SẢN XUẤT THƯƠNG MẠI NAM PHÚC'),
(2, 'Công ty TNHH Sản xuất Thương mại Nam Phúc chuyên sản xuất, gia công các loại Quần Jean thời trang, cung ứng cho thị trường trong nước và xuất khẩu nước ngoài.\nVới lợi thế đội ngũ công nhân viên tay nghề cao, máy móc hiện đại, nguồn nguyên liệu và chế độ hậu mãi tốt, sản phẩm của Nam Phúc luôn nhận được đánh giá cao từ khách hàng.\nBên cạnh đó, chúng tôi không ngừng cập nhật kiểu dáng, mẫu mã mới theo xu hướng thời trang, khí hậu và thời tiết từng mùa. Các sản phẩm đều được nghiên cứu kỹ càng sao cho phù hợp với phom dáng người Việt và xuất khẩu nước ngoài. Điều này đã tạo nên những nét nổi bật, khiến sản phẩm và dịch vụ của Nam Phúc thu hút đông đảo sự quan tâm và tin tưởng của người tiêu dùng.'),
(3, 'Giai đoạn phát triển'),
(4, 'Năm 1993 khởi nghiệp thành lập công ty\nHợp tác với tất cả siêu thị toàn quốc\nĐối tác lớn Big C, Lottle Mart, MM MEGA MARKET,  Sài gòn Coop, ....'),
(5, 'Tầm nhìn'),
(6, 'Công ty TNHH Sản xuất Thương mại Nam Phúc đang là đối tác hàng đầu của các công ty, tập đoàn thương mại lớn trong và ngoài nước như Big C, Lottle Mart, MM MEGA MARKET, Sài gòn Coop, .... Chúng tôi sẽ đẩy mạnh phát triển thương hiệu, mở rộng hợp tác, trở thành đơn vị sản xuất, gia công mặt hàng Jean thời trang tốt nhất thị trường.'),
(7, 'Sứ mệnh'),
(8, 'Sản xuất ra những sản phẩm Jean thời trang, chất lượng, phù hợp nhiều phom dáng; đồng thời có giá cả tốt nhất, đáp ứng nhu cầu tiêu dùng trong nước và xuất khẩu sang nước ngoài.'),
(9, 'Phương châm hoạt động'),
(10, 'Kể từ khi thành lập (1993), Nam Phúc luôn hoạt động theo phương châm \"cung ứng sản phẩm chất lượng, dịch vụ uy tín, giá cả cạnh tranh\". Chính vì vậy, chúng tôi đã xây dựng thành công thương hiệu trên thị trường cũng như niềm tin trong lòng người tiêu dùng.'),
(11, 'SẢN PHẨM PHÂN PHỐI'),
(12, 'Nam Phúc chuyên sản xuất và phân phối quần jeans cho tất các siêu thị trên toàn quốc'),
(13, 'SẢN PHẨM MỚI'),
(14, ''),
(15, 'Thời gian làm việc');
